@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATMResponse a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasMoneyDispensed ;
        owl:someValuesFrom atm:Money
    ] .

atm:hasMoneyDispensed a owl:ObjectProperty ;
    rdfs:domain atm:ATMResponse ;
    rdfs:range atm:Money .

atm:Money a owl:Class .
